import React from 'react'
import App from './App'
import { BrowserRouter, Routes, Route } from "react-router-dom";

const Home = () => {
    // write a function to click the button route to the App component
    // and then click the button to route back to the Home component
    function handleClick() {
        console.log('clicked')
        // route to the App component

    }
    return (
        <div>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<App />} />
                </Routes>
            </BrowserRouter>
            
        </div>
  )
}

export default Home
